# Information about Wolfram Language named operators.

# This information comes largely from Robert L. Jacobson's Table of
# Wolfram Language Operators found at:
# https://github.com/WLTools/LanguageSpec/blob/master/docs/Specification/Syntax/Operator%20Table.csv
#
# Some operator information attached to individual character names can
# be found in file "named-characters.yml".
#
# For a description of many of the fields below, see
#  https://www.robertjacobson.dev/posts/2018-09-03-generalizing-pemdas-what-is-an-operator/
# and:
# https://www.robertjacobson.dev/posts/2018-09-04-defining-the-wolfram-language-part-2-operator-properties/
#
# Operator Precedence
# ----------------------
#
# We have two kinds of operator precedence values listed: "precedence," which is used
# in Mathics3 (core), and an optional "Precedence-Function" which can be used
# to match WMA builtin-function Precedence[] values.

# In the Mathics3 parser of Mathics core, the integer "precedence"
# listed here is an integer used in specifying the order
# operations occur when one operator is juxtaposed against another
# operator.  A higher value means that the operator binds before an
# operator with a lower value.

# For example, the Times precedence 400 is higher than the Plus
# precedence 310 because a + b * c is a + (b * c), not (a + b) * c.
# Precedence is also used to force multi-character ASCII symbols like
# |-> to get treated as one unit and not split into two operators like
# | and ->. So the precedence of |-> has to be higher than |.
#
# Note: When there was a mismatch between Jacobson's table and the old
# Mathics code, we've used the old Mathics code.
#
# Boxing Operator Precedence
# ---------------------------
#
# WMA uses operators, like \/ (FractionBox) or \_ (SubscriptBox), in
# Boxing Expressions. Like any other operator, there is a precedence
# value for each operator indicated by the "precedence" field.
#
# But please note that boxing operators and their precedece should be
# thought of as distinct from expression operators and their
# precedence. The two generally do not mix in an expression. Boxing is
# a separate phase which is run after expression evaluation.
#
#
# arity (https://en.wikipedia.org/wiki/Arity)
# -------------------------------------------
#
# A fancy word for how many operands (arguments) the operator takes;
# it is some sort of positive integer. Acceptable values found in our table
# are:
#  - NullAry (0 arguments),
#  - Unary (1 argument),
#  - Binary (2 arguments)
#  - Infix (2 or more arguments; Binary is a special case of Infix having exactly 2 arguments)
#  - Ternary (3 arguments)
#  - n-ary (n arguments)
#
#
# precedence
# ----------
#
# An integer value of an operator that is used by the Mathics3 parser
# as described above.
#
# Precedence Function
# -------------------
#
#  This integer field is optional and only used when there is a
#  discrepancy between what WMA reports when using the function
#  Precedence[] and what Mathics3 requires, we note that here.
#
#   WolframLanguageData: a "PrecedenceRanks" value returned using:
#       WolframLanguageData[*operator_name*, "PrecedenceRanks"]
#     Example:
#       In[1] := WolframLanguageData["AddTo", "PrecedenceRanks"]
#       Out[1]= {{expr1 +=expr2 , AddTo[expr1 ,expr2]} -> 73
#
#     Note that 73 is a number that belongs to a different precedence
#     scheme than the one given by Precedence and used in Mathics3.
#
#     Also Note that WolframLanguageData can also be used to give the
#     ASCII and unicode character representations:

#       In[2] := WolframLanguageData["AddTo", "ShortNotations"]
#       Out[2]= {+=}
#       In[2] := WolframLanguageData["GreaterEqual", "ShortNotations"]
#       Out[7]= {>=, ≥}
#
# usage
# -----
#
#  This field is optional. When it appears, it is either string
#  containing an example of the use of this operator. When it is
#  helpful to give several examples because the operator can be used
#  in several forms, the field type is a list of strings.
#
# FullForm
# --------
#
#  This field is optional. A parsed FullForm translation of some usage strings.
#
# associativity
# --------------
#
#  When two or more of the same operator are used, which group should be
#  evaluated first? The associativity value determines this and is used by the Mathics3 parser. An
#  associativity value should be one of:
#
#       - None
#       - left
#       - non-associative
#       - right
#       - unknown
#
#  An operator tagged as "left" will appear in JSON tables under the key
#  "left-binary-operators", "right" will appear in the JSON table under the key
#  "right-binary-operators", "non-associative" under the key
#  "non-associative-operators", "unknown" under the key "miscellaneous-operators",
#   and None as "flat_binary_operators".
#
# box-operator
# ------------
#
# This field exists and is set to true if the operator is used in boxing. Boxing
# operators are enclosed in \(  \) pairs.
#
# operator
# --------
#
# This field exists for box-operators. In the future, we may expand to other operators.
# (Non-box operators are listed in fields of named-characters.)
# It is the string value for the operator.

# meaningful
# ---------
#  This field "true" if WMA defines a meaning for the operator and "false" if not.
#
#  See "Operators without Built-in Meanings"
#  https://reference.wolfram.com/language/tutorial/TextualInputAndOutput.html#41

